import React, { useEffect, useState } from "react";

const App = () => {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("/api")
      .then((response) => response.text())
      .then((data) => setMessage(data))
      .catch((err) => console.log("Error fetching data:", err));
  }, []);

  return (
    <div>
      <h1>Server Response:</h1>
      <p>{message}</p>
    </div>
  )
};

export default App;
